// Crear una funci칩n asincr칩nica para convertir el Blob en Base64
export const blobToBase64 = async (blob: Blob): Promise<unknown | string> => {
  return new Promise((resolve, reject) => {
    const reader = new FileReader();
    reader.onload = () => {
      // 'result' contendr치 la representaci칩n Base64 del Blob
      const base64String = reader.result as string;
      resolve(base64String);
    };
    reader.onerror = (error) => {
      reject(error);
    };

    // Leer el Blob como una cadena Base64
    reader.readAsDataURL(blob);
  });
};

export function toBase64(blob: Blob) {
  const reader = new FileReader();
  let base64: string | ArrayBuffer | null = '';
  reader.onload = () => {
    base64 = reader.result;
  };
  reader.readAsDataURL(blob);
  return base64;
}

export const convertBase64ToBlob = (pdfBase64: string) => {
  const byteCharacters = atob(pdfBase64);
  const byteNumbers = new Array(byteCharacters.length);
  for (let i = 0; i < byteCharacters.length; i++) {
    byteNumbers[i] = byteCharacters.charCodeAt(i);
  }
  const byteArray = new Uint8Array(byteNumbers);
  return new Blob([byteArray], { type: 'application/pdf' });
}

/**
 * @Description: Convierte un File a Base64
 * */
export const fileToBase64 = (file: File): Promise<string | null> => {
  return new Promise((resolve) => {
    const reader = new FileReader();

    reader.onload = (event) => {
      if (event.target && event.target.result) {
        resolve(event.target.result as string);
      } else {
        resolve(null);
      }
    };

    reader.onerror = () => {
      resolve(null);
    };

    reader.readAsDataURL(file);
  });
};

/**
 * @Description: Convierte un ArrayBuffer a Base64
 * */
export function uint8ArrayToString(uint8Array: Uint8Array): string {
  let str = '';
  for (let i = 0; i < uint8Array.length; i++) {
    str += String.fromCharCode(uint8Array[i]);
  }
  return str;
}
export function arrayBufferToBase64(arrayBuffer: ArrayBuffer): string {
  const uint8Array = new Uint8Array(arrayBuffer);
  const binaryString = uint8ArrayToString(uint8Array);
  return btoa(binaryString);
}

